        case 8:
            return gslpp::complex(getSMEFTCoeffEW("CuGR", 1, 1), getSMEFTCoeffEW("CuGI", 1, 1), false); // charm
        case 10:
            return gslpp::complex(getSMEFTCoeffEW("CuGR", 2, 2), getSMEFTCoeffEW("CuGI", 2, 2), false); // top
