    double muRG = 0;
    
    // Polarization factors
    double Pe = Pol_em, Pp = Pol_ep;
    double fLR, fRL, fLL, fRR;
    
    // LR, RL, LL, and RR cross sections    
    double sigmaSMeLRa0 = 0.0, sigmaeLRa0 = 0.0, sigmaSMeLRa1 = 0.0, sigmaeLRa1 = 0.0; 
