    //  Linear contribution from Higgs self-coupling
    dwidth += cLHd6 * deltaH3L1(C1) * deltaG_hhhRatio_mu(muRG);


    // Add modifications due to small variations of the SM parameters    
    dwidth += cHSM * (-12.271 * deltaMz()
            + 13.665 * deltaMh()
            + 1.85 * deltaaMZ()
            + 0.224 * deltaGmu());

