    CZll = CZll / (2.0 * (gZlL * gZlL + gZlR * gZlR));

    sf = 124479. * (1.0 / 2.0) * (2.0 * (gZlL * gZlL + gZlR * gZlR)) / (-0.5 * gZlL * v2); // Coefficient of the CZll term. From the getSMEFTCoeff("CHl1R",0,0) term in the ME.

