    double Cqu8R2233 = 0.0, Cqu8R3311 = 0.0, Cqu8R3322 = 0.0, Cqd1R3311 = 0.0, Cqd1R3322 = 0.0;
    double Cqd8R3311 = 0.0, Cqd8R3322 = 0.0; 
