    Cqu8R2233 = getSMEFTCoeff("Cqu8R",1,1,2,2, muRG); 
    Cqu8R3311 = getSMEFTCoeff("Cqu8R",2,2,0,0, muRG); 
    Cqu8R3322 = getSMEFTCoeff("Cqu8R",2,2,1,1, muRG); 
