    d_GF_mu = ((getSMEFTCoeff("CHl3R", 0, 0, mu) + getSMEFTCoeff("CHl3R", 1, 1, mu) - 0.5 * (getSMEFTCoeff("CllR", 0, 1, 1, 0, mu) + getSMEFTCoeff("CllR", 1, 0, 0, 1, mu))) * v2);

